package nine;

public class IntArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int[] raj = { 2, 3, 444444 };
		for (int i = 0; i < raj.length; i++) {
			System.out.println(raj[i]);
		}

		for (int output : raj) {

			System.out.println(output);
		}

		for (int output : raj) {
			System.out.println(output);
		}

	}

}
